import React from 'react';
import mypic from './Arezoo.jpg';

export default function AboutUs() {
    return (
        <> 
            <div></div>
            <div className="auth-form">
                <h1>Welcome to our store</h1>
                <p><img src={mypic} alt="Arezoo" width="200" height="200" align ="left" HSPACE="50"  /> 
                
                <body> Hello and thanks for stopping by!
                        My name is Arezoo and I have master of computer science specialized in machine learning. 
                        Painting is one of my hobbies and I am learning painting from my childhood. 
                        In this store, I am showing my art works that are under the category of realism. Also, I am
                        showing some other art works from local artists in different categories. I hope you enjoy visiting our website. 
                        If you may have any questions, or you may need any help, I would be more than happy to assist you. </body>
                
                </p>
                
            </div>
        </>
        
        
    )
}
